/* eslint-disable */
import React from "react";
import { v4 as uuidv4 } from "uuid";

import { Segment, Header, Card, Image, Placeholder, Button } from "semantic-ui-react";

export default function TitleView(props) {
    //  STUB
    const games = [
        {
            id: uuidv4(),
            path: "./assets/terrain/grass.png",
            content: "data:image/png;base64,"
        },
        {
            id: uuidv4(),
            path: "./assets/terrain/clay.png",
        },
        {
            id: uuidv4(),
            path: "./assets/terrain/stone.png",
        },
        {
            id: uuidv4(),
            path: "./assets/terrain/sand.png",
        },
    ];

    return (
        <Segment>
            <Header as="h1" textAlign="center">
                Fuzzy Knights
                <Header.Subheader>Defenders of the Forest</Header.Subheader>
            </Header>

            <Card.Group itemsPerRow={ 4 }>
                {
                    games.map((game, i) => (
                        <Card key={ game.id } onClick={ e => props.onWorld(game, i) }>
                            <Card.Content header={ `World ${ i + 1 }` } textAlign="center" />

                            <Card.Content textAlign="center">
                                <Image src={ game.content || game.path } wrapped ui={ false } width={ "100%" }/>
                            </Card.Content>
                    
                            <Card.Content extra>
                                { game.id }
                            </Card.Content>
                        </Card>
                    ))
                }
                <Card onClick={ e => console.warn("Make a new game!") }>
                    <Card.Content header="Create New World" textAlign="center" />
                    <Card.Content>
                        <Placeholder>
                            <Placeholder.Image square />
                        </Placeholder>
                    </Card.Content>
                </Card>
            </Card.Group>
        </Segment>
    )
}